import React, { useCallback, useEffect, useState, memo } from 'react';
import { useNavigate } from 'react-router-dom';
import styles from './Frame3.module.css';

const OrdersTable = memo(({ orders }) => (
  <table className={styles.scrollableTableContainer}>
    <thead>
      <tr className="head">
        <th>Name</th>
        <th>Quantity</th>
        <th>Price</th>
      </tr>
    </thead>
    <tbody>
      {orders.map((order, index) => (
        <tr key={order.id || index} className={styles.trow}>
          <td>{order.name}</td>
          <td>{order.quantity}</td>
          <td>{order.price}</td>
        </tr>
      ))}
    </tbody>
  </table>
));

const Frame3 = () => {
  const navigate = useNavigate();
  const [orderData, setOrderData] = useState([]);
  const [currentDate, setCurrentDate] = useState('');
  const [totalPrice, setTotalPrice] = useState(0);

  const onRectangleImage3Click = useCallback(() => {
    navigate('/frame-6');
  }, [navigate]);

  const onCHECKOUTTextClick = useCallback(() => {
    navigate('/frame-6');
  }, [navigate]);

  const updateCurrentDate = () => {
    const now = new Date();
    const day = now.getDate().toString().padStart(2, '0');
    const month = (now.getMonth() + 1).toString().padStart(2, '0');
    const year = now.getFullYear();
    setCurrentDate(`${day}/${month}/${year}`);
  };

  useEffect(() => {
    let isMounted = true;

    const fetchOrderData = async () => {
      try {
        const response = await fetch('http://192.168.31.224:6969/order');
        if (!response.ok) {
          throw new Error('Network response was not ok');
        }
        const data = await response.json();

        if (isMounted) {
          if (JSON.stringify(data) !== JSON.stringify(orderData)) {
            setOrderData(data);
            const total = data.reduce((acc, order) => acc + order.quantity * order.price, 0);
            setTotalPrice(total);
          }
        }
      } catch (error) {
        console.error('Error fetching orders:', error);
      }
    };

    fetchOrderData();
    updateCurrentDate();

    const intervalId = setInterval(() => {
      if (isMounted) {
        fetchOrderData();
        updateCurrentDate();
      }
    }, 5000); // Reduced frequency to every 5 seconds

    return () => {
      clearInterval(intervalId);
      isMounted = false;
    };
  }, [orderData]);

  return (
    <div className={styles.rectangleParent}>
      <img className={styles.frameChild} alt="" src="/rectangle-9@2x.png" />
      <img className={styles.frameItem} alt="" src="/rectangle-5@2x.png" />
      <div className={styles.date}>{`Date: ${currentDate}`}</div>
      <img className={styles.frameInner} alt="" src="/rectangle-11@2x.png" />
      <img
        className={styles.rectangleIcon}
        alt=""
        src="/rectangle-10@2x.png"
        onClick={onRectangleImage3Click}
      />
      <div className={styles.orderSummary}>Order Summary</div>
      <div className={styles.checkout} onClick={onCHECKOUTTextClick}>CHECKOUT</div>
      <div className={styles.subtotal}>Subtotal: ฿{totalPrice}</div>
      <div className={styles.lineDiv} />

      <div className={styles.frameChild}>
        <OrdersTable orders={orderData} />
      </div>
    </div>
  );
};

export default Frame3;
